import React, { Component } from 'react';
import '../css/App.css';
import {
    Navbar,
    NavbarBrand,
    NavbarToggler,
    Collapse,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem
} from 'reactstrap';
class AppHeader extends Component {
    state = {
        isOpen: false
    };
    toggle = this.toggle.bind(this);
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        })
    }
    render() {
        return (
            <Navbar className="navbar-style" expand="md">
                <NavbarBrand href="/">
                    <img src="/avatar_450x331.jpg" width="64" className="d-inline-block align-top" alt="Guinea Pig Olympics" />
                    Guinea Pig Olympics
                </NavbarBrand>
                <NavbarToggler onClick={this.toggle} />
                <Collapse isOpen={this.state.isOpen} navbar>
                <UncontrolledDropdown nav inNavbar>
                            <DropdownToggle nav caret>
                                Dropdown
                            </DropdownToggle>
                            <DropdownMenu right>
                                <DropdownItem href="/">Option 1</DropdownItem>
                                <DropdownItem>Option 2</DropdownItem>
                            </DropdownMenu>
                        </UncontrolledDropdown>
                    <Nav className="ml-auto" navbar>
                        <NavItem>
                            <NavLink href="/">Link</NavLink>
                        </NavItem>                        
                    </Nav>
                </Collapse>
            </Navbar>
        );
    }
}
export default AppHeader;
